  [],\n\t\"revision_timestamp\": \"2016-07-27T22:50:27.439400\",\n\t\"name\": \"study-design-assessment-for-waterfowl-production-surveys-on-tetlin-nwr\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Tetlin National Wildlife Refuge monitors
  waterfowl brood production every year. The same eleven clusters of water bodies
  have been observed each year since 1985. Given the constraints on personnel, time,
  and budgets, it is imperative that brood production surveys be conducted efficiently
  in terms of both choice of sampling design and choice of sampling effort. We review
  the current survey design, identify statistical issues, and recommend potential
  solutions. Major topics include the lack of a clearly defined target universe and
  sample frame, measurement issues (focusing on survey timing and within season mortality),
  and minimum sample size required to achieve desired level of precision in brood
  production estimates. The study concludes with a series of recommended tasks that
  the Refuge should undertake to improve the brood survey's efficiency and effectiveness.\",\n\t\"license_title\":
